var correspondenciaUrl=global_settings.urlCORS+"api/correspondenciaapi/";registrationModule.factory("correspondenciaRepository",function(r){return{getR:function(e){return r.get(correspondenciaUrl+"0-"+e)},getE:function(e){return r.get(correspondenciaUrl+"1-"+e)},getRecibida:function(e,n,o){return r.get(correspondenciaUrl+"2-"+e+"-"+n+"-"+o)},getEntregada:function(e,n,o){return r.get(correspondenciaUrl+"3-"+e+"-"+n+"-"+o)},cancelar:function(e,n){return r.get(correspondenciaUrl+"4-"+e+"-"+n)},add:function(e){return r.post(correspondenciaUrl,e)},"delete":function(e){return r["delete"](correspondenciaUrl+e.idCorrespondencia)},put:function(e){return r.put(correspondenciaUrl,e)}}});